import React, { useEffect, useState } from 'react';
import NavBar from '../common/components/NavBar';

function PersonalZonePage({ authToken }) {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    if (authToken) {
      setIsLoggedIn(true);
    }
  }, [authToken]);

  console.log('authToken:', authToken);

  return (
    <>
      <NavBar isLoggedIn={isLoggedIn} />
      <br /><br /><br />
      <h1 style={{textAlign: 'center'}}>Wineries IL</h1>
      {isLoggedIn ? (
        <>
          <h1 style={{textAlign: 'center'}}>Personal Zone</h1>
        </>
      ) : (
        <p style={{textAlign: 'center'}} >Please log in to access this content.</p>
      )}
    </>
  );
}

export default PersonalZonePage;
